  input: '"TEXT","F3A","","FEC Identification Number - C00411256  Pavich for Congress        This
    report represents the electronicallly filed version of the paper version of the
    amended April quarterly report for Pavich for Congress.    In our request for
    compliance letters, we advised the recipients that Federal regulations required
    their compliance, we did not ask for additional contributions and we included
    a return envelope.   In addition, we made calls to the donors in question.  To
    date, we have received employer and occupation information for the vast majority
    of the contributors which has been amended on our report.  There were several
    donors we were unable to reach either via oral or written requests and we have
    made all attempts to reach these people.      Also included in the list of contributors
    for whom we lacked employer information were numerous politcal action committees.  They
    have no employer or occupation as such, but we have amended the report to reflect
    their PAC status and the fact that, as entities, they lack employers   The summary
    page information has been amended to accurately reflect the information.    The
    pre-primary contributions over $1000 that were not entered into the system  were
    the result of clerical error.  We have altered our procedures to ensure that any
